import React from "react";
import "./App.css";
import Header from "./components/Header";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
        <Route path ="chat/">
            <h1>I am chat Page</h1>
          </Route>
          <Route path ="/">
            <h1>I am Home Page</h1>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;

